import React from "react";
import { Route , Routes } from "react-router-dom";
import Contact from "./Contact";
import About from "./About";
import Error from "./Error";
import Menu from "./Menu";
import Service from "./Service";
import User from './User.jsx';
import Search from "./Search";
 const App=()=>{
 return(
    <>
    <Menu />
      <Routes>
        <Route exact path="/" Component={()=><About name="About us" />} />
        <Route exact path="/service" Component={()=><Service name="Service us" />} />
        <Route  path="/user/:fname/:lname" Component={User} />
        <Route  path="/user/search" Component={Search} />
        <Route exact path="/contact" Component={()=><Contact name="Contact us" />} />
        <Route  Component={Error} />
      </Routes>
    </>
 )
 }

export default App;
